sys_variable_value.value:
(function paginate(variables, pageResponse) {
    //Change the limit above to configure results per page.

    var offset = parseInt(variables.offset);
    var limit = parseInt(variables.limit);
    var totalCount = parseInt(page_response.response_headers['X-Total-Count']);
    var nextOffset = offset + limit;

    if (nextOffset < totalCount) {
        variables.getNextPage = true;
        variables.offset = offset + limit;
        variables.offset = variables.offset.toString();
    } else {
        variables.getNextPage = false;
    }
    
})(variables, pageResponse);

